import React from 'react';
import './About.css';

function About() {
  return (
    <section id="about" className="about-section" data-aos="fade-up">
      <div className="container">
        <h2>About Us</h2>
        <p>
          Codeunia is a vibrant tech community dedicated to helping developers grow their skills through workshops, events, and collaborative projects.
        </p>
      </div>
    </section>
  );
}

export default About;
